 عدد من البلاغات لهذا اليوم الأربعاء كان حصيلتها تسع إصابات وعشر وفيات ، وحيث تلقت بلاغ عن وجود حادث عند الساعه٩:٠٠ صباحا في مركز مربه بعد المحكمة نتج عنه اربع إصابات وثلاث وفيات وعند الساعه ٩:٢٤صباحا استقبلت عمليات عسير بلاغ عن وجود حادث في موقع الثويله طريق ظهران الجنوب نجران ونتج عنه وفاتين. وعند الساعه ٦:٠٦ من مغرب هذا اليوم استقبلت غرفة العمليات بلاغ عن وجود حادث على طريق عبله -بيشه ونتج عن الحادث وفاه واحده.\r\nكما باشرت فرق الهلال الاحمر في مركز المجارده حادث في مثلث العسبلي عند الساعه ٧:٤٠ مساء ونتج عن الحادث ثلاث إصابات متفرقة وحاله وفاه واحده كما استقبلت العمليات عند الساعه ١٠:٤٥ليلا بلاغ عن حادث بمركز مربه - وادي وطده ونتج عن الحادث ثلاث إصابات وثلاث وفيات نسأل الله للمتوفين بالرحمه والمصابين بالشفاء العاجل ومن جهته نوه الشهري دعوته لجميع الاخوة قائدي المركبات بالتقيد بالسرعه النظاميه والالتزام بتعليمات المرور حفاظا على سلامتهم وسلامة من معهم.</p>","post_title":"20 إصابة ووفيات في حوادث متفرقة بعسير","post_excerpt":"","post_status":"publish","comment_status":"open","ping_status":"open","post_password":"","post_name":"20-%d8%a5%d8%b5%d8%a7%d8%a8%d8%a9-%d9%88%d9%88%d9%81%d9%8a%d8%a7%d8%aa-%d9%81%d9%8a-%d8%ad%d9%88%d8%a7%d8%af%d8%ab-%d9%85%d8%aa%d9%81%d8%b1%d9%82%d8%a9-%d8%a8%d8%b9%d8%b3%d9%8a%d8%b1","to_ping":"","pinged":"","post_modified":"2016-06-30 03:31:36","post_modified_gmt":"2016-06-30 00:31:36","post_content_filtered":"","post_parent":0,"guid":"http://kabrday.com/?p=4303","menu_order":0,"post_type":"post","post_mime_type":"","comment_count":0,"categories":[{"term_id":703,"name":"في","slug":"%d9%81%d9%8a","term_group":0,"pivot":{"object_id":4303,"term_taxonomy_id":703}},{"term_id":1044,"name":"المملكة اليوم","slug":"%d8%a3%d8%ae%d8%a8%d8%a7%d8%b1-%d8%a7%d9%84%d9%85%d9%85%d9%84%d9%83%d8%a9","term_group":0,"pivot":{"object_id":4303,"term_taxonomy_id":1044}},{"term_id":1072,"name":"20","slug":"20","term_group":0,"pivot":{"object_id":4303,"term_taxonomy_id":1072}},{"term_id":1073,"name":"إصابة","slug":"%d8%a5%d8%b5%d8%a7%d8%a8%d8%a9","term_group":0,"pivot":{"object_id":4303,"term_taxonomy_id":1073}},{"term_id":1074,"name":"ووفيات","slug":"%d9%88%d9%88%d9%81%d9%8a%d8%a7%d8%aa","term_group":0,"pivot":{"object_id":4303,"term_taxonomy_id":1074}},{"term_id":1075,"name":"حوادث","slug":"%d8%ad%d9%88%d8%a7%d8%af%d8%ab","term_group":0,"pivot":{"object_id":4303,"term_taxonomy_id":1075}},{"term_id":1076,"name":"متفرقة","slug":"%d9%85%d8%aa%d9%81%d8%b1%d9%82%d8%a9","term_group":0,"pivot":{"object_id":4303,"term_taxonomy_id":1076}},{"term_id":1077,"name":"بعسير","slug":"%d8%a8%d8%b9%d8%b3%d9%8a%d8%b1","term_group":0,"pivot":{"object_id":4303,"term_taxonomy_id":1077}}]},{"ID":4226,"post_author":1,"post_date":"2016-06-29 23:34:09","post_date_gmt":"2016-06-29 20:34:09","post_content":"تمكنت مواطنة بجدة عمرها 23 عاماً من جمع مبالغ مالية قدرت بملايين الريالات، من خلال إعلانها إدارة مساهمات مالية، الأمر الذي أوقعها في اتهامات بالنصب من قبل عدد من المساهمين، وصدر حكم بحسبها 10 أشهر.\r\n\r\nوأوضحت الفتاة التي أنهت لتوّها مدة محكوميتها، وفقاً لـ\"الرياض\"، أنها بريئة من تهمة التفريط في أموال المساهمين، لذلك برأتها المحكمة، وأن مستحقات المساهمين في حدود 45 مليون ريال وليست بالحجم الذي ذكر في الإعلام، مبينة أنها ضحية مؤامرة واحتيال، وأن قصتها شوهت عبر وسائل الإعلام والشائعات المغرضة.\r\n\r\nوتابعت الفتاة المتهمة بالنصب على عددٍ من المساهمين، أنها كانت تعمل بأحد البنوك السعودية، وتعرفت خلال عملها على أحد الأشخاص الذين يعملون في خارج المملكة في مجال العقار والبورصات العالمية، فنصحها هذا الشخص بإنشاء سجل تجاري، وساعدها بجلب تواكيل وساطة للتعامل معه ومع الشركات الدولية.\r\n\r\nوأضافت، أنها استشارت محامياً مختصاً في هذه الأمور، وتعاقدت معه ليكون محاميها بعقد سنوي، وفتح لها سجلات تجارية في المملكة وفي دبي، وبدأت العمل وفقاً لذلك، ومع استمرارها زاد إقبال المساهمين، إلى أن وصل الحد الذي لم تتمكن حتى من استقبال بعضهم والاعتذار لهم.\r\n\r\nوقالت الفتاة، إنها نظراً لتزايد ضغوط العمل عليها قررت ترك العمل، وأرسلت رسائل نصية للمساهمين تخبرهم برغبتها في فض الشراكة، وأن مبالغهم خارج المملكة وستصلهم قريباً، وبالفعل سلمت بعض المساهمين مستحقاتهم، وسافرت لدبي لإكمال بعض الإجراءات، لتفاجأ من قبل شريكها ومحاميها أن أمراً بالقبض صدر ضدها.\r\n\r\nولفتت إلى أنه أثناء وجودها في دبي تلقت اتصالاً من أحد العملاء، نفى لها صدور أمر بالقبض عليها وأنه يمكنها العودة للمملكة، فعادت وذهبت برفقة عمها المحامي للمحكمة لتوضيح موقفها، إلا أن بعض المبتزين قدموا شيكات، لتأمر المحكمة بحسبها، وحكم عليها بالسجن مدة 10 أشهر، كونها كانت تعمل بطريقة غير نظامية.","post_title":"‫تبرئة عشرينية من تهمة النصب.. والفتاة تكشف كيف جمعت ملايين الريالات من المساهمين‎","post_excerpt":"","post_status":"publish","comment_status":"open","ping_status":"open","post_password":"","post_name":"%e2%80%ab%d8%aa%d8%a8%d8%b1%d8%a6%d8%a9-%d8%b9%d8%b4%d8%b1%d9%8a%d9%86%d9%8a%d8%a9-%d9%85%d9%86-%d8%aa%d9%87%d9%85%d8%a9-%d8%a7%d9%84%d9%86%d8%b5%d8%a8-%d9%88%d8%a7%d9%84%d9%81%d8%aa%d8%a7%d8%a9","to_ping":"","pinged":"","post_modified":"2016-06-29 23:37:32","post_modified_gmt":"2016-06-29 20:37:32","post_content_filtered":"","post_parent":0,"guid":"http://kabrday.com/?p=4226","menu_order":0,"post_type":"post","post_mime_type":"","comment_count":0,"categories":[{"term_id":11,"name":"عام","slug":"%d8%b9%d8%a7%d9%85","term_group":0,"pivot":{"object_id":4226,"term_taxonomy_id":11}},{"term_id":484,"name":"تكشف","slug":"%d8%aa%d9%83%d8%b4%d9%81","term_group":0,"pivot":{"object_id":4226,"term_taxonomy_id":484}},{"term_id":861,"name":"من","slug":"%d9%85%d9%86","term_group":0,"pivot":{"object_id":4226,"term_taxonomy_id":861}},{"term_id":1015,"name":"تبرئة","slug":"%d8%aa%d8%a8%d8%b1%d8%a6%d8%a9","term_group":0,"pivot":{"object_id":4226,"term_taxonomy_id":1015}},{"term_id":1016,"name":"عشرينية","slug":"%d8%b9%d8%b4%d8%b1%d9%8a%d9%86%d9%8a%d8%a9","term_group":0,"pivot":{"object_id":4226,"term_taxonomy_id":1016}},{"term_id":1017,"name":"تهمة","slug":"%d8%aa%d9%87%d9%85%d8%a9","term_group":0,"pivot":{"object_id":4226,"term_taxonomy_id":1017}},{"term_id":1018,"name":"النصب","slug":"%d8%a7%d9%84%d9%86%d8%b5%d8%a8","term_group":0,"pivot":{"object_id":4226,"term_taxonomy_id":1018}},{"term_id":1019,"name":"والفتاة","slug":"%d9%88%d8%a7%d9%84%d9%81%d8%aa%d8%a7%d8%a9","term_group":0,"pivot":{"object_id":4226,"term_taxonomy_id":1019}},{"term_id":1020,"name":"كيف","slug":"%d9%83%d9%8a%d9%81","term_group":0,"pivot":{"object_id":4226,"term_taxonomy_id":1020}},{"term_id":1021,"name":"جمعت","slug":"%d8%ac%d9%85%d8%b9%d8%aa","term_group":0,"pivot":{"object_id":4226,"term_taxonomy_id":1021}},{"term_id":1022,"name":"ملايين","slug":"%d9%85%d9%84%d8%a7%d9%8a%d9%8a%d9%86","term_group":0,"pivot":{"object_id":4226,"term_taxonomy_id":1022}},{"term_id":1023,"name":"الريالات","slug":"%d8%a7%d9%84%d8%b1%d9%8a%d8%a7%d9%84%d8%a7%d8%aa","term_group":0,"pivot":{"object_id":4226,"term_taxonomy_id":1023}},{"term_id":1024,"name":"المساهمين","slug":"%d8%a7%d9%84%d9%85%d8%b3%d8%a7%d9%87%d9%85%d9%8a%d9%86","term_group":0,"pivot":{"object_id":4226,"term_taxonomy_id":1024}}]},{"ID":74,"post_author":1,"post_date":"2012-07-15 11:53:52","post_date_gmt":"2012-07-15 08:53:52","post_content":"سبق- الرياض: ازدادت وتيرة التكهُّنات بقرب نقل بطولة كأس الخليج للعام المقبل من العراق إلى السعودية، في أعقاب قرار الاتحاد الدولي لكرة القدم \"فيفا\" بحظر استضافة العراق لأي مباريات الودية؛ نظراً للظروف الاستثنائية وأحداث العنف الذي يجتاح البلاد حالياً.\n\nوتلقى الاتحاد العراقي إشعاراً من نظيره الدولي يفيد بعدم السماح بعد الآن بإقامة المباريات الودية على الملاعب العراقية، ونقلت وكالة الأنباء الفرنسية عن عضو الاتحاد العراقي لكرة القدم نعيم صدام قوله: \"تلقينا إشعاراً من الاتحاد الدولي يفيد بإيقاف إقامة المباريات الودية في الملاعب العراقية في الوقت الحاضر وإلى إشعار آخر؛ بسبب موجة العنف\"، مضيفاً: \"هذا شيء مؤسف\".\n\nوكان الاتحاد الدولي سمح في 21 مارس الماضي بإقامة المباريات الودية فقط على الملاعب العراقية للمنتخبات العراقية، وأبقى حظره على اللقاءات الرسمية، قبل أن يأتي قرار منع إقامة المباريات الودية.\n\nوبدوره أعلن رئيس الاتحاد العراقي لكرة القدم ناجح حمود تسلُّم الاتحاد العراقي لاستاد مدينة البصرة، المقرر أن يستضيف النسخة المقبلة من بطولة كأس الخليج العربي بنسختها الـ22، مؤكداً أن الملعب بات جاهزاً تماماً لاستضافة البطولة من اليوم.\n\nوبيَّن أنه تم تجهيز ملعب رديف وملعب التدريبات، وتابع قائلاً: \"يمكن القول إن المتبقي من الأعمال هو الإنارة الليلية للاستاد، والتي لن يتجاوز إنجازها أسابيع؛ حيث يُرجَّح الانتهاء تماماً منها قبل نهاية شهر يوليو الحالي\"، وشدد على أن استضافة البطولة حق أصيل للعراق.\n\nوشهدت العاصمة بغداد وبعض المحافظات خلال الأيام الماضية موجات عنف دموية طالت عدداً من ملاعب شعبية لكرة قدم آخرها حادث تفجيري قبل يومين، أودى بحياة تسعة فتيان تقلُّ أعمارهم عن 16 سنة جرَّاء انفجار عبوات ناسفة خلَّفت 25 جريحاً أيضاً.\n\nوكان مقتل مدرِّب فريق كربلاء لكرة القدم محمد عباس الجبوري الذي توفي قبل أيام، متأثراً بكسور في الجمجمة ونزيف حاد بعد تعرُّضه للضرب من قبل مجموعة من عناصر الشرطة، عقب مباراة ضمن الدوري المحلي في 23 يونيو الماضي الحدث الأبرز في ملاعب كرة القدم في العراق.","post_title":"توقُّعات بنقل &quot;خليجي 22&quot; من العراق للسعودية بسبب &quot;العنف&quot;","post_excerpt":"","post_status":"publish","comment_status":"open","ping_status":"open","post_password":"","post_name":"chat-format-post","to_ping":"","pinged":"","post_modified":"2012-07-15 11:53:52","post_modified_gmt":"2012-07-15 08:53:52","post_content_filtered":"","post_parent":0,"guid":"http://demo.wpbandit.com/peak/?p=74","menu_order":0,"post_type":"post","post_mime_type":"","comment_count":0,"categories":[{"term_id":16,"name":"مدارات عالمية","slug":"%d9%85%d8%af%d8%a7%d8%b1%d8%a7%d8%aa-%d8%b9%d8%a7%d9%84%d9%85%d9%8a%d8%a9","term_group":0,"pivot":{"object_id":74,"term_taxonomy_id":16}},{"term_id":86,"name":"إجتماع","slug":"%d8%a5%d8%ac%d8%aa%d9%85%d8%a7%d8%b9","term_group":0,"pivot":{"object_id":74,"term_taxonomy_id":86}},{"term_id":497,"name":"تواصل","slug":"%d8%aa%d9%88%d8%a7%d8%b5%d9%84","term_group":0,"pivot":{"object_id":74,"term_taxonomy_id":497}}]}]
